(22, '1056', NULL, 'Samsung Galaxy s22 Ultra 12/512GB Rose Red', 'Samsung Galaxy S22 Ultra 12/512 GB Dark Red Spójrz na przodzie Samsung Galaxy S22 Ultra 12/512 GB czerwony umieszczono ekran o wielkości 6,8 cala z odświeżaniem na poziomie 120 Hz. Dzięki temu każde oglądane sceny, czy ciekawe artykuły będą świetnej jakości. A efekt smużenia już nie będzie występował. Co ważne, są również wydajne aparaty. Wybierz odpowiedni i zacznij tworzyć niesamowite ujęcia. Natomiast całość zamknięto w eleganckiej obudowie. Poznaj jakość ultra, poznaj nowego Samsung Galaxy S22 Ultra.', 'Electronic', 'Samsung', 2, 100, '2023-06-19 15:30:00.000000', 0),
