(28, '176', NULL, 'Intel Core i5-12400 12th gen', 'Korzystaj z procesorów Intel stworzonych dla gamingu nowej generacji, takich jak wyposażony w 6 rdzeni i 12 wątków Intel Core i5-12400. Zapewnia on rewolucyjną wydajność dzięki wysokiemu taktowaniu do nawet 4,4 GHz. Pewnie zwyciężaj w kolejnych rozgrywkach i doświadcz imersji w nowe wirtualne światy. Wszystko to dzięki rewolucyjnej architekturze procesora skupiającej się na tym co, najważniejsze – gamingu.  Intel Core i5-12400 test kart graficznych Poznaj moc procesora Intel Core i5-12400 Kiedy liczą się FPS-y nie ma czasu na półśrodki, dlatego specjalnie dla Ciebie przetestowaliśmy Intel Core i5-12400 na platformie testowej z układem GeForce RTX 3090. Przekonaj się, ile FPS średnio wyciąga w grach ten CPU (rozdzielczość Full HD, ustawienia detali Ultra) oraz jaki wynik osiągnął w benchmarku CineBench R20 MC, teście kompresji 7-Zip i renderingu Corona.', 'Components', 'Intel', 2, 100, '2023-06-19 15:30:00.000000', 0),
(29, '79', NULL, 'Huawei Watch GT 2 46mm Sport Black', 'Odkryj Huawei Watch GT 2 Sport czarny w 360 stopniach Przekraczaj granice swoich możliwości z czarnym Huawei Watch GT 2 Sport. Wytrzymała, odporna na wodę konstrukcja z metalową kopertą i profilowanym szkłem 3D łączy w sobie sportowy charakter i subtelną elegancję. Oznacza to, że sprawdzi się zarówno na siłowni jak i podczas biznesowego spotkania. Watch GT 2 Sport zasila przełomowy procesor Kirin A1 oferujący wspaniałą wydajność i wsparcie AI. Dodatkowo, smartwatch wyposażono w bogaty zestaw czujników monitorujących aktywność oraz zestaw przydatnych funkcji multimedialnych.  Sprawdź, jak Huawei Watch GT 2 Sport czarny wygląda w rzeczywistości. Chwyć zdjęcie poniżej i przeciągnij je w lewo lub prawo aby obrócić produkt lub skorzystaj z przycisków nawigacyjnych.', 'Accessories', 'Huawei', 2, 99, '2023-06-19 15:30:00.000000', 0),
(30, '199', NULL, 'Keyboard Corsair K100 OPX Gold', 'Dołącz do gamingowej elity z klawiaturą Corsair K100 OPX Gold. Stworzona z myślą o graczach, przygotowana na to, by otworzyć Ci furtkę do świata e-sportu i wynieść na szczyty tabel rankingowych. Wytrzymała obudowa z aluminium anodowanego bez problemu sprosta wielogodzinnym bataliom w ulubionej grze. Natomiast ponadczasowy design w kolorze Midnight Gold sprawi, że nie oderwiesz od niej wzroku. Wybierz Corsair K100 OPX Gold i wyraź swój charakter.', 'Accessories', 'Corsair', 2, 98, '2023-06-19 15:30:00.000000', 4),
(31, '767', NULL, 'EVGA GeForce RTX 3070 Ti FTW3 ULTRA GAMING 8GB GDDR6X', 'orzystaj z nowatorskich technologii, takich jak Ray Tracing czy DLSS, dzięki karcie graficznej EVGA GeForce RTX 3070 Ti FTW3 ULTRA GAMING. To oparta o architekturę NVIDIA Ampere konstrukcja, zapewniająca wyjątkowe osiągi we współczesnych grach. O jej stabilną pracę w ogniu walki dba autorski układ chłodzenia iCX3. Dzięki oprogramowaniu Precision X1 będziesz w stanie monitorować pracę karty oraz przejmiesz pełną kontrolę nad jej parametrami.', 'Components', 'EVGA', 2, 98, '2023-06-19 15:30:00.000000', 4),
(32, '383', NULL, 'Xiaomi POCO X3 PRO NFC 8/256GB Phantom Black 120Hz', 'Genialna sylwetka oraz ogromny ekran to nowy Xiaomi POCO X3 PRO 8/256 GB czarny. Otwórz się na nowe doznania w swojej ulubionej grze i nigdy nie zwalniaj, a efekt smużenia nigdy nie zagości. Matryca ma odświeżanie 120 Hz oraz wielkość 6,67 cala dzięki temu każda akcja będzie płynna. Zdjęcia? Pewnie, Twórz je tylnym aparatem, a ujęcia będą naprawdę bardzo dobre. Co więcej, POCO X3 PRO oferuje ultraszybkie ładowanie, aby szybko powrócić do swoich zajęć. Bezawaryjna praca to tylko z POCO X3 PRO czarny.', 'Electronic', 'Xiaomi', 2, 100, '2023-06-19 15:30:00.000000', 0),
(33, '189', NULL, 'Apple AirPods Pro z MagSafe', 'Każdy detal słuchawek AirPods Pro został opracowany pod kątem maksymalnej wygody i idealnego dopasowania. Korekcja EQ dostraja automatycznie muzykę, aby zachwyciła Cię doskonałym brzmieniem.  Specjalny wewnętrzny mikrofon na bieżąco odbiera to, co dociera do Twojego ucha, dzięki czemu AirPods odpowiednio regulują niskie i średnie częstotliwości. Specjalne przetworniki generują dźwięk o niskim poziomie zniekształceń, wliczając w to potężne basy.  Ten model słuchawek AirPods Pro został wyposażony w etui ładujące MagSafe, które zapewni Ci nawet ponad 24 godziny odtwarzania muzyki. Wystarczy, że położysz etui na ładowarce MagSafe, która magnetycznie przyłączy się do niego i rozpocznie proces ładowania.', 'Electronic', 'Apple', 2, 99, '2023-06-19 15:30:00.000000', 0),
(34, '79', NULL, 'Nothing Ear (1) black ANC', 'Poznaj Nothing ear (1) - niezwykle lekkie, bo ważące 4,7 grama słuchawki bezprzewodowe o nieszablonowym wyglądzie i dużych możliwościach. Przezroczysta obudowa słuchawek ear (1) w czarnej kolorystyce pozwala zajrzeć do ich wnętrza, dzięki czemu możesz podziwiać wysoką jakość ich wykonania. Stabilną łączność bezprzewodową gwarantuje zastosowany moduł Bluetooth 5.2.  Dzięki słuchawkom Nothing ear (1) możesz odciąć się od otaczającego Cię zgiełku, korzystając z funkcji aktywnej redukcji hałasu (ANC). Niesamowitą jakość dźwięku zapewniają mocne przetworniki o średnicy 11,6 mm opracowane przez specjalistów z firmy Teenage Engineering.  Bezprzewodową swobodą korzystania ze słuchawek Nothing ear (1) możesz cieszyć się przez długi czas. W pełni naładowane słuchawki możesz używać nawet przez 5 godzin. Etui ładujące wydłuży ten czas nawet do 34 godzin. Etui ładujące możesz naładować przewodowo lub bezprzewodowo.', 'Electronic', 'Nothing Ear', 2, 98, '2023-06-19 15:30:00.000000', 0),
(35, '459', NULL, 'Dell S2721DGFA nanoIPS HDR', 'Specjalnie dla Ciebie przeprowadziliśmy testy matrycy, sprawdzając między innymi pokrycie barw, maksymalną jasność, podświetlenie, balans bieli i średni błąd delta E. Zmierzyliśmy kluczowe parametry, aby przedstawić Ci wszystkie możliwe zastosowania panelu. Przygotowaliśmy też krótkie podsumowanie oraz wykaz wad i zalet monitora.  Ocena x-komu Monitor dedykowany graczom. Wysokie pokrycie przestrzeni sRGB skutkuje w nasyconych i żywych kolorach. Niestety kalibracja fabryczna wymaga poprawy, co powoduje, że obraz delikatnie różni się względem skalibrowanego panelu. Dodatkowo niski kontrast przejawia się w jasnych czerniach oraz mało wyraźnych detalach w ciemnych scenach. Z drugiej strony wysoka jasność maksymalna cechuje się wyraźnym obrazem przy ostrym świetle dziennym.', 'Electronic', 'Dell', 2, 98, '2023-06-19 15:30:00.000000', 0),
(36, '699', NULL, 'HP Pavilion 15 Ryzen 5-4500/16GB/512/Win10 Silver', 'Poznaj HP Pavilion 15. Wyjątkową serię laptopów, która sprosta Twoim wszelkim oczekiwaniom. Nowoczesny procesor AMD Radeon™ oraz zintegrowany układ graficzny nigdy Cię nie zawiodą. To uniwersalne urządzenie sprawdzi się, gdy będziesz używać go do pracy w biurze lub zapragniesz zrelaksować się w domu przy multimediach, czy grze. Wszystko to obejrzysz na wysokiej klasy matowym ekranie w technologii IPS oraz w rozdzielczości Full HD. Zostań szczęśliwym posiadaczem laptopa HP Pavilion 15.', 'Electronic', 'HP', 2, 99, '2023-06-19 15:30:00.000000', 0),
(37, '1200', NULL, 'Huawei MateBook 16 R5-5600H/16GB/512/Win11 szary', 'Poznaj Huawei MateBook 16. Wyjątkową serię laptopów, która sprosta Twoim oczekiwaniom. Nowoczesny procesor oraz zintegrowany układ graficzny zagwarantują Ci optymalną wydajność. Huawei MateBook 16 sprawdzi się zarówno jako narzędzie do pracy biurowej, jak i centrum filmowo-gamingowej rozrywki. Podziwiaj naturalne kolory wyświetlane na ekranie w rozdzielczości 2,5 K.', 'Electronic', 'Huawei', 2, 100, '2023-06-19 15:30:00.000000', 0),
(38, '60000', NULL, 'Apple Mac Pro 28-Core XeonW 2,5GHz/1,5TB/4TB/2xPVegaIID', 'Procesor Intel Xeon W-3275M (28 rdzeni, od 2.50 GHz do 4.40 GHz, 38.50 MB cache) Pamięć RAM 1536 GB (DIMM DDR4, 2933 MHz) Maksymalna obsługiwana ilość pamięci RAM 1536 GB Liczba gniazd pamięci (ogółem / wolne) 12/0 Karta graficzna 2 x AMD Radeon™ Pro Vega II Duo Wielkość pamięci karty graficznej 2 x 65536 MB HBM2 (pamięć własna) Dysk SSD PCIe 4096 GB (2 x 2048 GB) Wbudowane napędy optyczne Brak Dźwięk Zintegrowana karta dźwiękowa Wbudowany głośnik Łączność Wi-Fi 5 (802.11 a/b/g/n/ac) LAN 10 Gbps Bluetooth Złącza - panel tylny USB 3.2 Gen. 1 - 2 szt. Thunderbolt 3 - 2 szt. Thunderbolt 3 (karta graficzna) - 8 szt. Wyjście słuchawkowe/wejście mikrofonowe - 1 szt. RJ-45 (LAN) - 2 szt. HDMI (karta graficzna) - 2 szt. AC-in (wejście zasilania) - 1 szt. Złącza - panel górny USB Typu-C (z Thunderbolt 3) - 2 szt. Zasilacz 1400 W Dodatkowe informacje Secure Enclave Obudowa na kółkach Karta Apple Afterburner Mysz i klawiatura w zestawie Mysz bezprzewodowa Dołączone akcesoria Kabel zasilający System operacyjny macOS Catalina Wysokość 557 mm Szerokość 218 mm Głębokość 450 mm Waga 18 kg Gwarancja 12 miesięcy (gwarancja producenta) Rodzaj gwarancji Standardowa Rok premiery 2019 Kod producenta Z0W3/P4/R7/D3/G4/AB/W Kod x-kom 534577', 'Electronic', 'Apple', 2, 100, '2023-06-19 15:30:00.000000', 0),
(39, '69', NULL, 'Philips TAPH805 Czarne', 'Philips TAPH805BK to słuchawki bezprzewodowe, które łączą w sobie wszystkie niezbędne cechy podnoszące komfort słuchania ulubionej muzyki. Jedną z nich jest aktywna redukcja szumów, dzięki której wyciszysz świat wokół siebie. Wysokiej jakości dźwięk pozwoli usłyszeć każdy detal. Ponadto takie funkcje jak sterowanie dotykowe, kompatybilność z asystentem głosowym czy szybkie ładowanie i długa praca na baterii sprawią, że słuchawki nauszne Philips TAPH805BK staną się Twoim ulubionym towarzyszem podczas podróży, pracy czy relaksu.', 'Headphones', 'Philips', 2, 92, '2023-06-19 15:30:00.000000', 5),
(46, '1220', NULL, 'Apple iPhone 14 pro max', 'Apple iPhone 14 Pro Max 128GB (złoty)\n\nWybierając smartfon, nie szukasz kompromisów? Chcesz korzystać ze sprzętu najwyższej klasy? W takim razie wybierz model Apple iPhone 14 Pro Max, w którym zastosowano innowacyjne rozwiązania i zapewniający najwyższą wydajność działania procesor Apple A16 Bionic.\n\nInteligentne okienko Dynamic Island reaguje na aktywność aplikacji, powiadomień i nie tylko\n\nPiękny i wyrazisty obraz na wysokiej klasy wyświetlaczu Super Retina XDR o przekątnej 6,7 cala\n\nNiedościgniona wydajność i szybkość działania dzięki procesorowi Apple A16 Bionic\n\nNiesamowita jakość fotografii zawdzięczana zestawowi zaawansowanych obiektywów\n\nW pełni naładowana bateria smartfona zapewnia cały dzień rozrywki i pracy\n\nIntuicyjna obsługa dzięki nowoczesnemu oprogramowaniu iOS 16\n\nFunkcja Alarmowe SOS – wykrywanie wypadków i wzywanie pomocy\n\nNajlepszy smartfon do filmów i robienia selfie – zaawansowane opcje fotograficzne\n\n', 'Electronic', 'Apple', 2, 100, '2023-06-19 15:30:00.000000', 0),
